import { isEmpty } from "common/utils/collections"

export const ID_EVENT = "id"
export const ID_EVENT_ALTERNATIVE = "id_evento"
export const EVENT_CREATION_TIMESTAMP = "evento_infevento_dhregpassagem"
export const EVENT_RECEPTION_TIMESTAMP = "data_recebimento"
export const EVENT_INGESTION_TIMESTAMP = "saved_at"
export const EVENT_LOCAL = "evento_infevento_dsreflocal"
export const EVENT_VEHICLE_TYPE = "evento_infevento_dstipoveiculo"
export const EVENT_VEHICLE_MODEL = "evento_infevento_nomarcamodelo"
export const EVENT_VEHICLE_COLOUR = "evento_infevento_nocor"
export const EVENT_VEHICLE_PLATE = "evento_infevento_nrplaca"
export const EVENT_LATITUDE = "evento_infevento_nrlatitude"
export const EVENT_LONGITUDE = "evento_infevento_nrlongitude"
export const EVENT_DFE_TYPE = "evento_tipo_dfe"
export const EVENT_UF = "evento_infevento_sguf"
export const EVENT_TOTAL_VALUE = "evento_valor_tot_cmdfe"

export const WITHOUT_DFE = "NA"



export class Event {

    
    constructor(dataObject) {

        this.id_evento = !isEmpty(dataObject[ID_EVENT_ALTERNATIVE]) ? dataObject[ID_EVENT_ALTERNATIVE] : dataObject[ID_EVENT]
        this.event_creation_timestamp = dataObject[EVENT_CREATION_TIMESTAMP]
        this.event_reception_timestamp = dataObject[EVENT_RECEPTION_TIMESTAMP]
        this.event_ingestion_timestamp = dataObject[EVENT_INGESTION_TIMESTAMP]
        this.event_local = dataObject[EVENT_LOCAL]
        this.event_vehicle_type = dataObject[EVENT_VEHICLE_TYPE]
        this.event_vehicle_model = dataObject[EVENT_VEHICLE_MODEL]
        this.event_vehicle_colour = dataObject[EVENT_VEHICLE_COLOUR]
        this.event_vehicle_plate = dataObject[EVENT_VEHICLE_PLATE]
        this.event_logitude = dataObject[EVENT_LONGITUDE]
        this.event_latitude = dataObject[EVENT_LATITUDE]

    }

    getEventId(){
        return this.id_evento
    }

    getCreationTimestamp(){
        return this.event_creation_timestamp
    }

    getReceptionTimestamp(){
        return this.event_reception_timestamp
    }

    getIngestionTimestamp(){
        return this.event_ingestion_timestamp
    }
    
    getLocal(){
        return this.event_local
    }

    getVehicleType(){
        return this.event_vehicle_type
    }

    getVehicleModel(){
        return this.event_vehicle_model
    }

    getVehicleColour(){
        return this.event_vehicle_colour
    }

    getVehiclePlate(){
        return this.event_vehicle_plate
    }

    getLongitude(){
        return this.event_logitude
    }

    getLatitude(){
        return this.event_latitude
    }


}
